      const data = deviceData
      const firstDay = '2020-05-18'
      const lastDay  = '2020-06-07'

      function initialize() {
        const dayRange = (isoStart, isoEnd) => {
          const start = new Date(isoStart + ' 12:00')
          const end = new Date(isoEnd + ' 12:00')
          let range = []
          let day = start
          while (day <= end) {
            range.push(new Date(day))
            day.setDate(day.getDate() + 1)
          }
          return range
        }
        const daySelector = $('#startDay')
        const fiFmt = Intl.DateTimeFormat('fi', {year: 'numeric', month: 'numeric', day: 'numeric', weekday: 'short'})
        dayRange(firstDay, lastDay).forEach(day => (
          $(`<option value="${day.toISOString().substring(0,10)}">${fiFmt.format(day)}</option>`)
            .appendTo(daySelector)
          )
        )
        daySelector.change(drawCharts)
        drawCharts()
      }

      function drawCharts() {
        $('#timelines').empty()
        const dataTable = new google.visualization.DataTable()
        dataTable.addColumn({ type: 'string', id: 'Origin' })
        dataTable.addColumn({ type: 'string', id: 'Device' })
        dataTable.addColumn({ type: 'string', id: 'Distance' })
        dataTable.addColumn({ type: 'date', id: 'Start' })
        dataTable.addColumn({ type: 'date', id: 'End' })
        dataTable.addColumn({ type: 'string', id: 'Type' })
        dataTable.addRows(data)

        const day = $('#startDay').val()
        const minTime = new Date(day+' 00:00')
        const maxTime = new Date(day+' 23:59')
        const dayRange = { column: 3, minValue: minTime, maxValue: maxTime }

        const withDevice = (device) => `${device} (${deviceTypes[device]})`
        const tgtWithDevice = (table, row) => withDevice(table.getValue(row, 1))

        const origins = dataTable.getDistinctValues(0).sort()
        origins.forEach(id => {
          const dataView = new google.visualization.DataView(dataTable)
          dataView.setColumns([{ type: 'string', id: 'Direction', calc: tgtWithDevice },2,3,4])
          dataView.setRows(dataTable.getFilteredRows([{ column: 0, value: id}, dayRange]))
          drawChart(id, withDevice(id), dataView, minTime, maxTime)
        })
      }

      function drawChart(id, name, view, minTime, maxTime) {
        if (view.getViewRows().length === 0) return

        $('#timelines').append(`<div id="${id}"><h1>${name}</h1><div id="timeline-${id}" class="timeline"></div></div>`)
        const container = document.getElementById(`timeline-${id}`)
        const chart = new google.visualization.Timeline(container)

        chart.draw(view, {
          timeline: { colorByRowLabel: true },
          hAxis: {
            format: 'HH:mm',
            minValue: minTime,
            maxValue: maxTime
          }
        })
      }

      a { color: black; text-decoration: none; margin-right: 1em }
      select { margin-bottom: 1em }
      #days { position: fixed; top: 0; left: 0; background-color: lightgray; z-index: 999; width: 100%; padding: 10px 5px 5px 5px }
      #timelines { margin-top: 70px; }

    <title>Personal timelines</title>
